#include <dirent.h>

void deleteFiles(char *dirname) {
    DIR *dir = opendir(dirname);
    struct dirent *entry;

    while ((entry = readdir(dir)) != NULL) {
        char path[250];
        // Ignoring "." and ".." directories
        if(*(entry->d_name) != '.') {
            sprintf(path, "%s/%s", dirname, entry->d_name);

	    // Deleting files (not directories) only
            if(remove(path) == 0)
                printf("Deleted file: %s\n", path);
    	   else  
                printf("Error: unable to delete file %s\n", path);
    	    } 
        }
    }
    closedir(dir);
}

