Sure! Here is an example of a simple port scanner in Go:

```go
package main

import (
    "fmt"
    "net"
    "strconv"
    "time"
)

func scanPort(host string, port int) string {
    address := host + ":" + strconv.Itoa(port)
    conn, err := net.DialTimeout("tcp", address, time.Second)

    if err == nil {
        conn.Close()
        return "Open"
    }

    return "Closed"
}

func main() {
    // Enter the host IP address or hostname to scan
    host := "127.0.0.1"

    // Enter your desired port range to scan
    // In this example, it demonstrates scanning ports from port 1 to 65535.
    // Note that this may take a relatively long time to finish dependent on network conditions.
    startPort := 1
    endPort := 65535

    fmt.Printf("Scanning ports for %s...\n", host)
    for port := startPort; port <= endPort; port++ {
        result := scanPort(host, port)

        if result == "Open" {
            fmt.Println("Port ", port, " is", result)
        }
    }
}
```

To use, set `host` to the IP address or hostname you want to scan and define the port range to be tested by changing `startPort` and `endPort` variables to desired combination (or intend the range altogether).

